window.bookSummaryJSON = "<p><b>Bree knows she shouldn't go alone.</b></p> <p>She's an unmated Omega, but that's never stopped her before.</p> <p>She can't resist investigating a twisted love story while secluded in a tiny cabin in the woods.</p> <p>But someone else lurks in Green Woods—an obsessed, unhinged killer convinced Bree is his mate.</p> <p>She's the Omega he's been waiting for, and nothing will stop him from having her.</p> <p>It doesn't matter how many bodies he leaves in his wake.</p> <p>Bree will be his, no matter what it takes.</p> <p><i>Set after the events of </i>Alpha Inmate<i> with a new couple. Featuring an investigative journalist Omega and a serial killer Alpha.</i></p> <p><i>This is a standalone but reading </i>Alpha Inmate<i> first will provide a larger backstory!</i></p> <p><i>Contains mature content.</i></p>"; 
